import React from "react";
import { Heading } from "../components/Heading";
import { AppInput } from "../components/AppInput";
import { AppCheckbox } from "../components/UI/AppCheckbox";

export const AcceptPage = () => {
  return (
    <div className="container">
      <div className="wrapper">
        <div className="AcceptPage">
          <Heading
            headingType="h1"
            text="АКЦЕПТ на предложение о заключении договора"
          />
          <form>
            <AppInput
              inputLabel="Ф.И.:"
              placeholder="Ваш ответ"
              type="text"
            />
            <AppInput
              inputLabel="Номер телефона:"
              placeholder="+998 9- --- -- --"
              type="tel"
            />
            <AppCheckbox checkboxLabel="Ознакомился с публичной офертой" />
            <AppCheckbox checkboxLabel="Согласен с условиями публичной оферты" />
            <button buttonText="Далее" />
          </form>
        </div>
      </div>
    </div>
  );
};
